import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import './App.css'
import Home from './components/pages/Home'
import Services from "./components/pages/Services";
import Products from "./components/pages/Products";
import SignUp from "./components/pages/SignUp";
import WorldMap from "./components/WorldMap";
import ReactDOM from "react-dom";
import { ComposableMap, Geographies, Geography, Marker, Annotation, ZoomableGroup} from "react-simple-maps";
import ReactTooltip from 'react-tooltip'
import 'semantic-ui-css/semantic.min.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// url to a valid topojson file
// const geoUrl =
//   "https://unpkg.com/world-atlas@1.1.4/world/110m.json";

// function App() {
//   return (
//     <>
//       <Router>
//         <Navbar />
//         <Routes>
//           {/* <Route path='/' exact Component={Home} /> */}
//           <Route path="/" exact Component={WorldMap} />
//           <Route path='/services' exact Component={Services} />
//           <Route path='/products' exact Component={Products} />
//           <Route path='/sign-up' exact Component={SignUp} />
//         </Routes>
//       </Router>
//     </>
//   );
// }

// export default App

import React, { useState } from 'react';

function App() {
  const [mealPlan, setMealPlan] = useState([]);
  const [favorites, setFavorites] = useState([]);
  const [articles, setArticles] = useState([]);
  const [region, setRegion] = useState('Your Region');

  const generateMealPlan = () => {
    // Placeholder function to generate a meal plan
    setMealPlan(['Meal 1', 'Meal 2', 'Meal 3']);
  };

  const addFavorite = (meal) => {
    setFavorites([...favorites, meal]);
  };

  const readArticle = () => {
    // Placeholder function to fetch daily articles
    setArticles(['Article 1', 'Article 2']);
  };

  const handleInstacart = () => {
    // Placeholder function for Instacart integration
    alert('Ingredients added to Instacart!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Healthy Meal Planner</h1>
        <p>Eat healthy and on time, effortlessly!</p>
      </header>

      <section className="meal-plan-section">
        <h2>Your Weekly Meal Plan</h2>
        <button onClick={generateMealPlan}>Generate Meal Plan</button>
        <ul>
          {mealPlan.map((meal, index) => (
            <li key={index}>
              {meal} 
              <button onClick={() => addFavorite(meal)}>Add to Favorites</button>
            </li>
          ))}
        </ul>
      </section>

      <section className="favorites-section">
        <h2>Your Favorites</h2>
        <ul>
          {favorites.map((meal, index) => (
            <li key={index}>{meal}</li>
          ))}
        </ul>
      </section>

      <section className="articles-section">
        <h2>Daily Articles</h2>
        <button onClick={readArticle}>Read Today's Articles</button>
        <ul>
          {articles.map((article, index) => (
            <li key={index}>{article}</li>
          ))}
        </ul>
      </section>

      <section className="region-section">
        <h2>Regional Menus</h2>
        <p>Explore popular dishes from your region: {region}</p>
        <select onChange={(e) => setRegion(e.target.value)}>
          <option value="Your Region">Your Region</option>
          <option value="Region 1">Region 1</option>
          <option value="Region 2">Region 2</option>
        </select>
      </section>

      <section className="instacart-section">
        <h2>Instacart Integration</h2>
        <button onClick={handleInstacart}>Add Ingredients to Instacart</button>
      </section>
    </div>
  );
}

export default App;
